import{_ as e,o as i,c as l,d as r}from"./app.00f4d6fa.js";const f=JSON.parse('{"title":"Features","description":"","frontmatter":{"aside":true},"headers":[{"level":2,"title":"U1: Raspberry Pi RP2040 Micrcontroller","slug":"u1-raspberry-pi-rp2040-micrcontroller","link":"#u1-raspberry-pi-rp2040-micrcontroller","children":[]},{"level":2,"title":"U2: U-blox® Nina W102 WiFi/Bluetooth Module","slug":"u2-u-blox®-nina-w102-wifi-bluetooth-module","link":"#u2-u-blox®-nina-w102-wifi-bluetooth-module","children":[]},{"level":2,"title":"U4: Microchip® ATECC608A Crypto","slug":"u4-microchip®-atecc608a-crypto","link":"#u4-microchip®-atecc608a-crypto","children":[]},{"level":2,"title":"U5: Memory","slug":"u5-memory","link":"#u5-memory","children":[]},{"level":2,"title":"U6: Power","slug":"u6-power","link":"#u6-power","children":[]},{"level":2,"title":"U8: ST MP34DT06JTR MEMS Microphone","slug":"u8-st-mp34dt06jtr-mems-microphone","link":"#u8-st-mp34dt06jtr-mems-microphone","children":[]},{"level":2,"title":"U9: ST LSM6DSOXTR 6-axis IMU","slug":"u9-st-lsm6dsoxtr-6-axis-imu","link":"#u9-st-lsm6dsoxtr-6-axis-imu","children":[]}],"relativePath":"guide/features.md","lastUpdated":1673881432000}'),t={name:"guide/features.md"},a=r('<h1 id="features" tabindex="-1">Features <a class="header-anchor" href="#features" aria-hidden="true">#</a></h1><p>For more details, refer to the official <a href="https://docs.arduino.cc/static/000ac72a5da192041f15cd4a8de8dda9/ABX00053-datasheet.pdf" target="_blank" rel="noreferrer">Product Reference Manual</a>.</p><p>The Arduino Nano RP2040 Connect integrated ICs with the following features:</p><h2 id="u1-raspberry-pi-rp2040-micrcontroller" tabindex="-1">U1: Raspberry Pi RP2040 Micrcontroller <a class="header-anchor" href="#u1-raspberry-pi-rp2040-micrcontroller" aria-hidden="true">#</a></h2><ul><li>133MHz 32bit Dual Core ARM® Cortex®-M0+</li><li>264kB on-chip SRAM</li><li>Direct Memory Access (DMA) controller</li><li>Support for up to 16MB of off-chip Flash memory via dedicated QSPI bus</li><li>USB 1.1 controller and PHY, with host and device support</li><li>8 PIO state machines</li><li>Programmable IO (PIO) for extended peripheral support</li><li>4 channel ADC with internal temperature sensor, 0.5 MSa/s, 12-bit conversion</li><li>SWD Debugging</li><li>2 on-chip PLLs to generate USB and core clock</li><li>40nm process node</li><li>Multiple low power mode support</li><li>USB 1.1 Host/Device</li><li>Internal Voltage Regulator to supply the core voltage</li><li>Advanced High-performance Bus (AHB)/Advanced Peripheral Bus (APB)</li></ul><h2 id="u2-u-blox®-nina-w102-wifi-bluetooth-module" tabindex="-1">U2: U-blox® Nina W102 WiFi/Bluetooth Module <a class="header-anchor" href="#u2-u-blox®-nina-w102-wifi-bluetooth-module" aria-hidden="true">#</a></h2><ul><li>240MHz 32bit Dual Core Xtensa LX6</li><li>520kB on-chip SRAM</li><li>448 Kbyte ROM for booting and core functions</li><li>16 Mbit FLASH for code storage including hardware encryption to protect programs and data</li><li>1 kbit EFUSE (non- erasable memory) for MAC addresses, module configuration, Flash-</li><li>Encryption, and Chip-ID</li><li>IEEE 802.11b/g/n single-band 2.4 GHz WiFi operation</li><li>Bluetooth 4.2</li><li>Integated Planar Inverted-F Antenna (PIFA)</li><li>4x 12-bit ADC</li><li>3x I2C, SDIO, CAN, QSPI</li></ul><h2 id="u4-microchip®-atecc608a-crypto" tabindex="-1">U4: Microchip® ATECC608A Crypto <a class="header-anchor" href="#u4-microchip®-atecc608a-crypto" aria-hidden="true">#</a></h2><ul><li>Cryptographic Co-Processor with Secure Hardware-Based Key Storage</li><li>I2C, SWI</li><li>Hardware Support for Symmetric Algorithms: <ul><li>SHA-256 &amp; HMAC Hash including off-chip context save/restore</li><li>AES-128: Encrypt/Decrypt, Galois Field Multiply for GCM</li></ul></li><li>Internal High-Quality NIST SP 800-90A/B/C Random Number Generator (RNG)</li><li>Secure Boot Support: <ul><li>Full ECDSA code signature validation, optional stored digest/signature</li><li>Optional communication key disablement prior to secure boot</li><li>Encryption/Authentication for messages to prevent on-board attacks</li></ul></li></ul><h2 id="u5-memory" tabindex="-1">U5: Memory <a class="header-anchor" href="#u5-memory" aria-hidden="true">#</a></h2><ul><li>AT25SF128A 16MB NOR Flash</li><li>QSPI data transfer rate up to 532Mbps</li><li>100K program/erase cycles</li></ul><h2 id="u6-power" tabindex="-1">U6: Power <a class="header-anchor" href="#u6-power" aria-hidden="true">#</a></h2><ul><li>Buck step-down converter</li></ul><h2 id="u8-st-mp34dt06jtr-mems-microphone" tabindex="-1">U8: ST MP34DT06JTR MEMS Microphone <a class="header-anchor" href="#u8-st-mp34dt06jtr-mems-microphone" aria-hidden="true">#</a></h2><ul><li>AOP = 122.5 dBSPL</li><li>64 dB signal-to-noise ratio</li><li>Omnidirectional sensitivity</li><li>-26 dBFS ± 1 dB sensitivity</li></ul><h2 id="u9-st-lsm6dsoxtr-6-axis-imu" tabindex="-1">U9: ST LSM6DSOXTR 6-axis IMU <a class="header-anchor" href="#u9-st-lsm6dsoxtr-6-axis-imu" aria-hidden="true">#</a></h2><ul><li>3D Gyroscope <ul><li>±2/±4/±8/±16 g full scale</li></ul></li><li>3D Accelerometer <ul><li>±125/±250/±500/±1000/±2000 dps full scale</li></ul></li><li>Advanced pedometer, step detector and step counter</li><li>Significant Motion Detection, Tilt detection</li><li>Standard interrupts: free-fall, wakeup, 6D/4D orientation, click and double-click</li><li>Programmable finite state machine: accelerometer, gyroscope and external sensors</li><li>Machine Learning Core</li><li>Embedded temperature sensor</li></ul>',17),o=[a];function n(c,s,d,u,p,h){return i(),l("div",null,o)}const b=e(t,[["render",n]]);export{f as __pageData,b as default};
